class Solution:
    def scheduleCourse(self, courses):
        courses.sort(key=lambda x: x[1])
        heap = []
        time = 0
        for duration, end in courses:
            if duration + time <= end:
                heappush(heap, -duration)
                time += duration
            elif heap and -heap[0] > duration:
                time -= -heappop(heap)
                heappush(heap, -duration)
                time += duration
        return len(heap)
